					<span itemprop="description"><p><strong>VIVA.co.id -</strong> Ketua Komisi III DPR Bambang Soesatyo, membenarkan adanya operasi tangkap tangan oleh KPK terhadap salah satu anggota Komisi III.</p>

<p>Anggota tersebut, diduga dari Fraksi Partai Demokrat. Namun Bambang memastikan tidak terkait kegiatan di komisi.</p>

<p>"Saya sudah cek, tidak terkait dengan tupoksi Komisi III. Lebih kepada kegiatan Banggar," kata Bambang, saat dikonfirmasi, Rabu 29 Juni 2016.</p>

<p>Bambang mengaku sedih dengan penangkapan rekan sejawat di komisinya tersebut. Bambang yang juga Ketua DPP Golkar, menyebut Putu sebagai sosok yang humoris.</p>

<p>"Kami semua di Komisi III sedih dan prihatin. Putu (I Putu Sudiartana) adalah sahabat yang baik dan humoris. Nggak ada Putu nggak rame," tutur Bambang.</p>

<p>Saat ini, KPK juga sudah menyegel ruang anggota tersebut di DPR.</p>

<p>Tim Satuan Tugas KPK dikabarkan telah menangkap seorang anggota DPR karena diduga terkait dengan tindak pidana korupsi. Anggota dewan itu disebut-sebut berasal dari Komisi lll DPR Fraksi Partai Demokrat berinisial IPS.</p>

<p>Saat dikonfirmasi, Wakil Ketua KPK, Laode Muhammad Syarif tidak menampiknya. Namun menurut Syarif, penjelasan lebih detail akan diberikan pada konferensi pers nanti.</p>

<p>"Tunggu sore saja detailnya," kata Syarif.</p>
</span>																											</div></article>
			
